import React from "react";

const WordsList = ({ words }) => {
  return (
    <div>
      {words &&
        words.map((word) => {
          return (
            <div>
              <h4>{word.title}</h4>
              <p>{word.definition}</p>
            </div>
          );
        })}
    </div>
  );
};

export default WordsList;
